import logo from './logo.svg';
import './App.css';
import EmailBlock from './EmailBlock';
import PassWordBlock from'./PassWordBlock';
import SigninButton from './SigninButton';

const styles = {
  center: {
    marginLeft: "auto",
    marginRight: "auto"
  }
}

function App() {
  return (
    <div classname="App">
      <div className={styles.center}>
        {
          EmailBlock()
        }
        </div>
        <div className={styles.center}>      
          {
            PassWordBlock()
          }
        </div>
        <div className={styles.center}>
          {
            SigninButton()
          }
        </div>
      </div>
  );
} 

export default App;
